const inputText = $('Information Extractor1').first().json.output.keywords_table;

try {
  const trimmed = inputText.trim();
  const data = JSON.parse(trimmed);

  // Фильтруем только объекты
  const onlyObjects = data.filter(item => typeof item === 'object' && item !== null && !Array.isArray(item));

  if (onlyObjects.length > 0) {
    const emptyObject = Object.keys(onlyObjects[0]).reduce((acc, key) => {
      acc[key] = "."; // Или "" если нужно пусто
      return acc;
    }, {});
    onlyObjects.push(emptyObject);
  }

  return onlyObjects.map(obj => ({ json: obj }));

} catch (e) {
  return [{ json: { error: e.message, raw: inputText } }];
}

const inputText = $('Information Extractor1').first().json.output.negative_keywords;

try {
  const trimmed = inputText.trim();
  const arr = JSON.parse(trimmed);

  // Добавляем пустой объект в конец массива
   if (arr.length > 0) {
    arr.push({"============NEW ATTEMPT============": ""});
  }

  return arr.map(item => ({
    json: { value: item }
  }));

} catch (e) {
  return [
    {
      json: {
        error: e.message,
        raw: inputText
      }
    }
  ];
}

